import "./NavBar.css";
import Search from "./Search";
import About from './About'

function NavBar() {
  return (
    <div className="navbar-container">
      <div className="navbar-contents">
        <h1>Mauro's Movie App</h1>
        <Search />
      </div>
      <div className="nav-bar-about">
        <About/>
      </div>
    </div>
  );
}

export default NavBar;
